import React from 'react';
import { Box, Typography, Paper, Divider } from '@mui/material';

const TestResults = ({ results, isSubmission }) => {
  if (!results || results.length === 0) {
    return null;
  }

  const allPassed = results.every(test => test.passed);
  const totalTests = results.length;
  const passedTests = results.filter(test => test.passed).length;

  // Unicode symbols for pass/fail
  const CHECK_MARK = '✓';
  const CROSS_MARK = '✗';

  return (
    <Box sx={{ width: '100%', mt: 2 }}>
      <Paper 
        sx={{ 
          p: 2, 
          bgcolor: '#1a1a1a',
          border: '1px solid',
          borderColor: allPassed ? '#4caf50' : '#f44336',
          borderRadius: '8px'
        }}
      >
        {/* Summary Header */}
        <Box sx={{ 
          display: 'flex', 
          alignItems: 'center', 
          mb: 2,
          color: allPassed ? '#4caf50' : '#f44336'
        }}>
          <span style={{ marginRight: '8px', fontSize: '1.5rem' }}>
            {allPassed ? CHECK_MARK : CROSS_MARK}
          </span>
          <Typography variant="h6" component="div">
            {allPassed ? 'All Test Cases Passed!' : 'Some Tests Failed'}
          </Typography>
          <Typography 
            variant="body2" 
            sx={{ ml: 'auto', color: '#8c8c8c' }}
          >
            {passedTests}/{totalTests} passed
          </Typography>
        </Box>

        <Divider sx={{ mb: 2, bgcolor: '#404040' }} />

        {/* Test Cases */}
        {results.map((test, index) => (
          <Box 
            key={index}
            sx={{
              mb: 2,
              p: 1.5,
              borderRadius: '4px',
              bgcolor: '#282828',
              border: '1px solid',
              borderColor: test.passed ? '#1b5e20' : '#b71c1c',
              '&:last-child': { mb: 0 }
            }}
          >
            <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
              <span 
                style={{ 
                  marginRight: '8px', 
                  color: test.passed ? '#4caf50' : '#f44336',
                  fontSize: '1.2rem'
                }}
              >
                {test.passed ? CHECK_MARK : CROSS_MARK}
              </span>
              <Typography variant="subtitle2" sx={{ color: '#cccccc' }}>
                Test Case {index + 1}
              </Typography>
            </Box>

            <Box sx={{ ml: 4 }}>
              <Typography variant="body2" sx={{ color: '#8c8c8c', mb: 0.5 }}>
                Input:
                <Box component="span" sx={{ ml: 1, color: '#cccccc', fontFamily: 'monospace' }}>
                  {test.input}
                </Box>
              </Typography>

              <Typography variant="body2" sx={{ color: '#8c8c8c', mb: 0.5 }}>
                Expected:
                <Box component="span" sx={{ ml: 1, color: '#cccccc', fontFamily: 'monospace' }}>
                  {test.expectedOutput}
                </Box>
              </Typography>

              <Typography variant="body2" sx={{ color: '#8c8c8c' }}>
                Output:
                <Box 
                  component="span" 
                  sx={{ 
                    ml: 1, 
                    color: test.passed ? '#4caf50' : '#f44336',
                    fontFamily: 'monospace'
                  }}
                >
                  {test.actualOutput}
                </Box>
              </Typography>
            </Box>
          </Box>
        ))}

        {/* Submission Stats */}
        {isSubmission && (
          <>
            <Divider sx={{ my: 2, bgcolor: '#404040' }} />
            <Box sx={{ display: 'flex', justifyContent: 'space-between' }}>
              <Typography variant="body2" sx={{ color: '#8c8c8c' }}>
                Status: 
                <Box 
                  component="span" 
                  sx={{ 
                    ml: 1,
                    color: allPassed ? '#4caf50' : '#f44336',
                    fontWeight: 'bold'
                  }}
                >
                  {allPassed ? 'Accepted' : 'Wrong Answer'}
                </Box>
              </Typography>
              <Typography variant="body2" sx={{ color: '#8c8c8c' }}>
                Runtime: {results[0]?.runtime || '0'} ms
              </Typography>
              <Typography variant="body2" sx={{ color: '#8c8c8c' }}>
                Memory: {results[0]?.memory || '0'} MB
              </Typography>
            </Box>
          </>
        )}
      </Paper>
    </Box>
  );
};

export default TestResults;
